{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":8763363,"sourceType":"datasetVersion","datasetId":5265382}],"dockerImageVersionId":30618,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/donpiumsuwan/demo-polynomial-regression?scriptVersionId=185018412\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Polynomial Regression in Data Visualisation in R\n\nThis notebook provide a quick demonstration on how to visualise the trends in data using linear regression. However, in most case, the relationship between predictor and target variable is not linear. In this case, we can use the polynomial regression - the enhance version of linear regression - to capture non-linearity. \n\nThere are two common enhancements for linear regression: interaction terms and polynomial regression. These methods help capture more complex relationships between predictors and the target variable. In this demonstration, we focus on polynomial regression.\n\nThe dataset used for this demonstration is adapted from the Emergency Events Data (EM-DAT Data) by the Centre for Research on the Epidemiology of Disasters (CRED).","metadata":{}},{"cell_type":"code","source":"# Libraries\n\nrequire(tidyverse)\nrequire(visdat)\nrequire(ggplot2)\nrequire(repr)\nrequire(caret)","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:27.460745Z","iopub.execute_input":"2024-06-23T10:58:27.463123Z","iopub.status.idle":"2024-06-23T10:58:33.491315Z"},"trusted":true},"execution_count":1,"outputs":