 45.48 -6.71 -19.84 ...\n $ CentralLongitude      : num [1:18251] 80.93 9.1 6.94 110.53 -174.82 ...\n - attr(*, \"spec\")=\n  .. cols(\n  ..   DisasterNumber = \u001b[31mcol_character()\u001b[39m,\n  ..   ClassificationKey = \u001b[31mcol_character()\u001b[39m,\n  ..   Country = \u001b[31mcol_character()\u001b[39m,\n  ..   ISO = \u001b[31mcol_character()\u001b[39m,\n  ..   Region = \u001b[31mcol_character()\u001b[39m,\n  ..   Location = \u001b[31mcol_character()\u001b[39m,\n  ..   Subregion = \u001b[31mcol_character()\u001b[39m,\n  ..   DisasterGroup = \u001b[31mcol_character()\u001b[39m,\n  ..   DisasterSubgroup = \u001b[31mcol_character()\u001b[39m,\n  ..   DisasterType = \u001b[31mcol_character()\u001b[39m,\n  ..   Year = \u001b[32mcol_double()\u001b[39m,\n  ..   TotalDeaths = \u001b[32mcol_double()\u001b[39m,\n  ..   NumberInjured = \u001b[32mcol_double()\u001b[39m,\n  ..   NumberAffected = \u001b[32mcol_double()\u001b[39m,\n  ..   NumberHomeless = \u001b[32mcol_double()\u001b[39m,\n  ..   TotalAffected = \u001b[32mcol_double()\u001b[39m,\n  ..   TotalDamageAdjustedUSD = \u001b[32mcol_double()\u001b[39m,\n  ..   CentralLatitude = \u001b[32mcol_double()\u001b[39m,\n  ..   CentralLongitude = \u001b[32mcol_double()\u001b[39m\n  .. )\n - attr(*, \"problems\")=<externalptr> \n","output_type":"stream"}]},{"cell_type":"markdown","source":"## The Visualisation\nIn this demonstration, we will visualise annual trends of global disaster by subgroup from 1990 to 2023. We will also look at the death case of each disaster subgroup by year. This visualisation aims to present the frequency of disaster subgroups and their impact measured by death case.","metadata":{}},{"cell_type":"code","source":"# Select and filter data \ndisaster_subgroup_yearly <- diasaster_data %>%\n  filter(Year < 2024) %>%  # filter for data before 2024\n  group_by(Year, DisasterGroup, DisasterSubgroup) %>%\n  summarise(\n    TotalDisasterCount = n(),\n    TotalDeaths = sum(TotalDeaths, na.rm = TRUE)) %>%\n  ungroup()\n\n# Look at first 6 rows\nhead(disaster_subgroup_yearly)","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:36.931662Z","iopub.execute_input":"2024-06-23T10:58:36.934506Z","iopub.status.idle":"2024-06-23T10:58:37.370002Z"},"trusted":true},"execution_count":3,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Year', 'DisasterGroup'. You can override\nusing the `.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 5</caption>\n<thead>\n\t<tr><th scope=col>Year</th><th scope=col>DisasterGroup</th><th scope=col>DisasterSubgroup</th><th scope=col>TotalDisasterCount</th><th scope=col>TotalDeaths</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>1990</td><td>Natural      </td><td>Biological         </td><td> 16</td><td> 2140</td></tr>\n\t<tr><td>1990</td><td>Natural      </td><td>Climatological     </td><td> 14</td><td>    0</td></tr>\n\t<tr><td>1990</td><td>Natural      </td><td>Geophysical        </td><td> 38</td><td>42946</td></tr>\n\t<tr><td>1990</td><td>Natural      </td><td>Hydrological       </td><td> 58</td><td> 2330</td></tr>\n\t<tr><td>1990</td><td>Natural      </td><td>Meteorological     </td><td>134</td><td> 5561</td></tr>\n\t<tr><td>1990</td><td>Technological</td><td>Industrial accident</td><td> 21</td><td>  606</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 5\n\n| Year &lt;dbl&gt; | DisasterGroup &lt;chr&gt; | DisasterSubgroup &lt;chr&gt; | TotalDisasterCount &lt;int&gt; | TotalDeaths &lt;dbl&gt; |\n|---|---|---|---|---|\n| 1990 | Natural       | Biological          |  16 |  2140 |\n| 1990 | Natural       | Climatological      |  14 |     0 |\n| 1990 | Natural       | Geophysical         |  38 | 42946 |\n| 1990 | Natural       | Hydrological        |  58 |  2330 |\n| 1990 | Natural       | Meteorological      | 134 |  5561 |\n| 1990 | Technological | Industrial accident |  21 |   606 |\n\n","text/latex":"A tibble: 6 × 5\n\\begin{tabular}{lllll}\n Year & DisasterGroup & DisasterSubgroup & TotalDisasterCount & TotalDeaths\\\\\n <dbl> & <chr> & <chr> & <int> & <dbl>\\\\\n\\hline\n\t 1990 & Natural       & Biological          &  16 &  2140\\\\\n\t 1990 & Natural       & Climatological      &  14 &     0\\\\\n\t 1990 & Natural       & Geophysical         &  38 & 42946\\\\\n\t 1990 & Natural       & Hydrological        &  58 &  2330\\\\\n\t 1990 & Natural       & Meteorological      & 134 &  5561\\\\\n\t 1990 & Technological & Industrial accident &  21 &   606\\\\\n\\end{tabular}\n","text/plain":"  Year DisasterGroup DisasterSubgroup    TotalDisasterCount TotalDeaths\n1 1990 Natural       Biological           16                 2140      \n2 1990 Natural       Climatological       14                    0      \n3 1990 Natural       Geophysical          38                42946      \n4 1990 Natural       Hydrological         58                 2330      \n5 1990 Natural       Meteorological      134                 5561      \n6 1990 Technological Industrial accident  21                  606      "},"metadata":{}}]},{"cell_type":"code","source":"# Set plot size\noptions(repr.plot.width=12, repr.plot.height=8)\n\n# Plot the disaster subgroups by year, as well as death case.\nggplot(disaster_subgroup_yearly, \n       aes(x = Year, y = TotalDisasterCount, size = TotalDeaths, color = DisasterSubgroup)) +\n  geom_point(alpha = 0.8) +\n  scale_size_continuous(range = c(1, 8)) +\n  scale_x_continuous(breaks = seq(min(disaster_subgroup_yearly$Year), \n                                  max(disaster_subgroup_yearly$Year), \n                                  by = 1)) +\n  theme_classic() +\n  scale_color_viridis_d(option = \"H\") +\n  labs(title = \"Annual Trend of Disaster Count by Disaster Subgroup and To