a = y ~ x,\n                se = FALSE,\n                lwd = 1,\n                linetype = \"dashed\") +\n    scale_size_continuous(range = c(1, 8)) +\n    scale_x_continuous(breaks = seq(min(disaster_subgroup_yearly$Year), \n                                  max(disaster_subgroup_yearly$Year), \n                                  by = 1)) +\n    theme_classic() +\n    scale_color_viridis_d(option = \"H\") +\n    labs(title = \"Annual Trend of Disaster Count \nby Disaster Subgroup and Total Deaths with Regression Line\",\n       x = \"Year\",\n       y = \"Disaster Count\",\n       size = \"Total Deaths\",\n       color = \"Disaster Subgroup\") +\n  theme(plot.title = element_text(size = 18, face = \"bold\", hjust = 0.5),\n      legend.position = \"right\", \n        axis.title = element_text(size=15, face=\"bold\"), \n        axis.text.y = element_text(size=12), \n        legend.text = element_text(size=12),\n        legend.title = element_text(size=12, face=\"bold\"),\n        axis.text.x = element_text(angle=45, vjust=0.5)) ","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:44.881639Z","iopub.execute_input":"2024-06-23T10:58:44.883497Z","iopub.status.idle":"2024-06-23T10:58:46.096036Z"},"trusted":true},"execution_count":5,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2DUZB8H8Ce3R/emm9GWVfYWEVC2oCJb2aioIAqi+CoCKoIIOFFREJSlDGUK\nyN4ge28oLRRoS/e4Xu/uef+4kktv9ZpeL732+/nrLnme5MmT555LfkmeMJRSAgAAAAAAAADg\nzkRCFwAAAAAAAAAAoLwQ4AAAAAAAAAAAt4cABwAAAAAAAAC4PQQ4AAAAAAAAAMDtIcABAAAA\nAAAAAG4PAQ4AAAAAAAAAcHsIcAAAAAAAAACA20OAAwAAAAAAAADcHgIcACC8szNbMBxyz6Za\nKnSZBOInFbP18NLVdPuJ9w+OYcpuZlKOa7bFKTY3DWZLHtVjZ4WvjxaumjWhdcOankqZRCpT\nefr235PseAnNSKRyL7/guEZtBo6ZtGLXFVtLKNNOryTy753e99jBozeELk4J5/b8PeOdUe2a\nxUeGBipliqCw6MYt2g6bMH39vnM6N+9YKnO1AwAAVAYSoQsAAECmfXWJ+1Wbe+ajK+lz6vkJ\nVR6otja81mLILxfYrwW5mVlaPe+l6XXanIyUnIyUa+ePrV48f3rHoWs2LGriJXNGSQV2e+3r\nHd8+ZvzsETo