 labs(title = \"Annual Trend of Disaster Count \nby Disaster Subgroup and Total Deaths with Regression Line Degree 2\",\n       x = \"Year\",\n       y = \"Disaster Count\",\n       size = \"Total Deaths\",\n       color = \"Disaster Subgroup\") +\n  theme(plot.title = element_text(size = 18, face = \"bold\", hjust = 0.5),\n      legend.position = \"right\", \n        axis.title = element_text(size=15, face=\"bold\"), \n        axis.text.y = element_text(size=12), \n        legend.text = element_text(size=12),\n        legend.title = element_text(size=12, face=\"bold\"),\n        axis.text.x = element_text(angle=45, vjust=0.5)) ","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:49.48139Z","iopub.execute_input":"2024-06-23T10:58:49.483213Z","iopub.status.idle":"2024-06-23T10:58:50.517936Z"},"trusted":true},"execution_count":6,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2DUZB8H8Ce3R1vo3qUFWmbZeyhD2aAiW5GpooIICKKCiIIgywUqCgIi8IqI\nsgREtgjK3pvSUqCU0j2ut573j2tz6a3epdcb5fv565I8SZ48ee5J8kvyhKGUEgAAAAAAAAAA\nbyZwdwYAAAAAAAAAACoKAQ4AAAAAAAAA8HoIcAAAAAAAAACA10OAAwAAAAAAAAC8HgIcAAAA\nAAAAAOD1EOAAAAAAAAAAAK+HAAcAAAAAAAAAeD0EOAAAAAAAAADA6yHAAQDud3ZuC4ZD6ttU\nTd2dJzcJEAvZcnjhaqbtxIeGxjOOm3snzzXb4hTbm4ayOa/R869KXx8t3jBvYuuGcb5yiUgs\nUfj6D9x/z/4cmhCJpX4BoXUatRk8dsq6vVesLcGhne4hCu+ePljq72M33J2dMs7t/232pNHt\nmiXGRATLJbKQyNjGLdq+NPHD3w+e03p5w+LJxQ4AAOAJRO7OAAAAmfXZJe6gOv/MjCuZC+oF\nuCs/8Nja8mqLYd9fYAeL8rNz1DreS9Np1XlZ6XlZ6dfO/7tx5ZIPOw3/ZcuKJn4SZ+TUzZI2\nvdbprX8Nv30ixufd/cq9+THIOPHr+Lcm/3wkhTtSdS/54b3kcyePrf1ydnBizy9WrBraKtRd\nOawgzyx2AAAAz4EnOADAzfJTv9zyqMhk5Mapf7slM/A406mShv1wqfx0fN04sLZ9ne4n8jWV\nt4rH2eVNH8S3HWQS3TDx8PzOF9rFTf7xgo00AAAA4L3wBAcAuNmJmcvMR97d+2aOrm81IeP6\n/HgRZXRCw4Yyk5EpVy7lavWG30JJeL2EQJMEQWKEti0rzNhYqNOzgyOX/jquaZCoTrD9S2AE\n0gb149nB4vzse3fuFXCWWZh24Jk+i+8emM6dq17Dhuwui5IIeeb+8ZZ+bF7jQXM0tMwrKAwj\n9PX3p6qcvEJjUInqij4f1SKodvJ77bz1OQ4AAACwBgEOAHArvWr