AAABswxkc\nAAAAAAAAAMA8bHAAAAAAAAAAAPOwwQEAAAAAAAAAzMMGBwAAAAAAAAAwDxscAAAAAAAAAMA8\nbHAAAAAAAAAAAPOwwQEAAAAAAAAAzMMGBwAAAAAAAAAwDxscAAAAAAAAAMA8bHAAAAAAAAAA\nAPOwwQEAAAAAAAAAzMMGBwAAAAAAAAAwDxscAAAAAAAAAMA8bHAAAAAAAAAAAPOwwQEAAAAA\nAAAAzPs/xeYWJJaLLAMAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":720,"height":480}}}]},{"cell_type":"markdown","source":"## Choosing the Best Polynomial Degrees\n\nEventhough model with degree of 2 starts to capture the complexity in the data, we cannot be certain about the performance of the model. We need a more mathemathical methods to determine the good fit of the regression line. In this case, we consider **AIC (Akaike Information Criterion)** and **BIC (Bayesian Information Criterion)** as criteria for model selection.\n\n**AIC** is used when we want to identify the best predictive model. It is calculated by AIC = 2k-2ln(L), where k is numbers of parameters and L is the maximum likelihood of the model. To determine the good fit of the model, we aim for lower AIC (Brownlee, 2019; MachineLearningQuickNotes, 2021).\n\n**BIC** is used when we are concerned with overfitting. It is calculated by BIC = ln(n)k - 2ln(L), where n is the number of oberservations, k is numbers of parameters, and L is the maximum likelihood of the model. To determine the good fit of the model, we also look for lower BIC (Brownlee, 2019; MachineLearningQuickNotes, 2021).\n\nBased on our analysis, the lower AIC suggests a better fit with a degree of 5, while a lower BIC suggests a simpler model with a degree of 2. We can plot AIC and BIC against number of degree to better compare the performance.","metadata":{}},{"cell_type":"code","source":"# Comparing AIC and BIC for degree 1 to 10\naic_bic <- sapply(1:10, function(deg) {\n  lm_model <- lm(TotalDisasterCount ~ poly(Year, deg), data = disaster_subgroup_yearly)\n  c(AIC = AIC(lm_model), BIC = BIC(lm_model))\n})\n\naic_bic","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:53.631441Z","iopub.execute_input":"2024-06-23T10:58:53.633327Z","iopub.status.idle":"2024-06-23T10:58:53.693058Z"},"trusted":true},"execution_count":7,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A matrix: 2 × 10 of type dbl</caption>\n<tbody>\n\t<tr><th scope=row>AIC</th><td>2959.733</td><td>2954.434</td><td>2954.172</td><td>2954.044</td><td>2953.213</td><td>2955.212</td><td>2956.977</td><td>2958.699</td><td>2960.688</td><td>2962.686</td></tr>\n\t<tr><th scope=row>BIC</th><td>2970.561</td><td>2968.872</td><td>2972.220</td><td>2975.701</td><td>2978.479</td><td>2984.087</td><td>2989.462</td><td>2994.793</td><td>3000.393</td><td>3005.999</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA matrix: 2 × 10 of type dbl\n\n| AIC | 2959.733 | 2954.434 | 2954.172 | 2954.044 | 2953.213 | 2955.212 | 2956.977 | 2958.699 | 2960.688 | 2962.686 |\n| BIC | 2970.561 | 2968.872 | 2972.220 | 2975.701 | 2978.479 | 2984.087 | 2989.462 | 2994.793 | 3000.393 | 3005.999 |\n\n","text/latex":"A matrix: 2 × 10 of type dbl\n\\begin{tabular}{r|llllllllll}\n\tAIC & 2959.733 & 2954.434 & 2954.172 & 2954.044 & 2953.213 & 2955.212 & 2956.977 & 2958.699 & 2960.688 & 2962.686\\\\\n\tBIC & 2970.561 & 2968.872 & 2972.220 & 2975.701 & 2978.479 & 2984.087 & 2989.462 & 2994.793 & 3000.393 & 3005.999\\\\\n\\end{tabular}\n","text/plain":"    [,1]     [,2]     [,3]     [,4]     [,5]     [,6]     [,7]     [,8]    \nAIC 2959.733 2954.434 2954.172 2954.044 2953.213 2955.212 2956.977 2958.699\nBIC 2970.561 2968.872 2972.220 2975.701 2978.479 2984.087 2989.462 2994.793\n    [,9]     [,10]   \nAIC 2960.688 2962.686\nBIC 3000.393 3005.999"},"metadata":{}}]},{"cell_type":"code","source":"# Convert AIC and BIC value to dataframe\naic_bic_df <- as.data.frame(t(aic_bic))\naic_bic_df$Degree <- 1:10\n\n# Plot to compare AIC and BIC against number of degree\nggplot(aic_bic_df, aes(x = Degree)) +\n    geom_line(aes(y = AIC, color = \"AIC\")) +\n    geom_line(aes(y = BIC, color = \"BIC\")) +\n    scale_x_continuous(breaks = seq(1,10, by = 1)) +\n    labs(title = \"AIC and BIC for Polynomial Degrees 1 to 10\",\n         x = \"Polynomial Degree\",\n         y = \"Criterion Value\",\n         color = \"Model Selection Criteria\") +\n    theme_minimal() +\n    theme(plot.title = element_text(size = 20, face = \"bold\", hjust = 0.5),\n          legend.position = \"right\", \n          axis.title = element_text(size=15, face=\"bold\"), \n          axis.text.y = element_text(size=15), \n          legend.text = element_text(size=15),\n          legend.title = element_text(size=15, face=\"bold\"),\n          axis.text.x = element_text(size = 15, vjust=0.5)) ","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:55.621978Z","iopub.execute_input":"2024-06-23T10:58:55.624276Z","iopub.status.idle":"2024-06-23T10:58:56.114763Z"},"trusted":true},"execution_count":8,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUdf7H8e9sT++QhBBISCOABVGxgdjLqYcoKHZ/iuWwnHqoiB1U0LOinsgp\n9oaoZ1fsYseCBJIQCIQQQiCQskm2zvz+CCazm02yqTObvJ5/8GBnvzP5zM7s7Mx75jsjKYoi\nAAAAAAAAQplB6wIAAAAAAAB6ioADAAAAAACEPAIOAAAAAAAQ8gg4AAAAAABAyCPgAAAAAAAA\nIY+AAwAAAAAAhDwCDgAAAAAAEPIIOAAAAAAAQMgj4ACC8sO14yRfx7xc0vEox8SFqds/vr2h\nw+bKuu8+WDT3yqMOmZA9Mi06zBKTmJI3bvwxp5x7/9I3S3Y5e3FeNLe76Bz1J3PkaxuDHLF+\n6wKpQwaDISwyNmV49tGnzrx7ydu73HLA6ehn0di3fHH9eSfnpiWFWYxmqy06LnH6x+U9mWAv\n2vDcpE4+baM1Likld/8jLrp67nu/9H7ZD42KU/+5Xp/+gNEXH1S3p7n5naM7WmdM5ojIuBFZ\n+cecetbtDz6zfpejV6oFAADYSwHQOe/kWKvfdycmc17H4xwda1O3X1xhb69l2apXz5yY1sH3\nVDKEnTTr7o0N7t6eL21UF85Uz93kV0uCHLGubH6Xtm9hQw58+ovyttPRyaJp3Plhhs3kN8Gj\n3i7txqT6QvGyI7r0aY+fflu509OLBTyYGauefi9OeYDpiw+q29Msffuo4NcZgynmnHkv9uZK\ngx774Z/7mkwmk8kUN/LG7k2hoXJZmsrRd/zWuxV2VfBz1Fj525PzrzvygLHDkmLMYTEjc8Yd\nN+PKFz9azSoKACGEKziAztWVLvyqxv9EfV3pfd/VuXo+8c/+fX7G4We/8UNHJ8AVuemDJbeO\nHXnoW8W1Pf+Lg0dT1c+XHTv20R+qujd6Xy+ajy+4vNTh6V5tOvTr63ftf/gNTbKidSEIGbKn\n9qX55+43c1FT