K496Gh0AAACA8WGTUQAAMNSb16USdd7e1SH7\nskuISCS2WDMY35zrmdeMnhkHNnLxeN/P//dT6J8cxI+uH1+y6heu0cJl+Fpf+/obIAAAAICR\nYYkKAAAYKsTFcktGEX/p1ndb6tmx9Tcc0Ij//sugpYdU1f2jt2ze9+DVo/2che02CgAAAPAh\nwxIVAAAwJjMHvx3xwfU9CiAiGrH4wPOrB2b9JcCnlZulmVQskdk4NO0+IOCHTb8+SzmD6gYA\nAAB8ZDCDAwAADLVn4bQTr4qtHZxad+g+InCQkxTVcwAAAAB431DgAAAAAAAAAIAGDz+yAQAA\nAAAAAECDhwIHAAAAAAAAADR4KHAAAAAAAAAAQIOHAgcAAAAAAAAANHgocAAAAAAAAABAg4cC\nBwAAAAAAAAA0eChwAAAAAAAAAECDhwIHAAAAAAAAADR4KHAAAAAAAAAAQIP3f77AHhAwXalT\nAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":720,"height":480}}}]},{"cell_type":"markdown","source":"### Using Cross-validation to Evaluate Models\n\nWe use cross-validation to evaluate both polynomial degree of 2 and 5. It is found that the degree 5 model had a slightly lower RMSE and slightly higher R-squared, which indicate a better fit. Considering a very small different between two model, we can opt for degree 2 model, which provide simplicity and good performance. However, we have already visualised model with degree of 2. Thus, we will proceed with degree 5 model, which also provide a good performance, but with more complexity.\n","metadata":{}},{"cell_type":"code","source":"set.seed(56)\n# Define train control\ntrain_control <- trainControl(method = \"cv\", number = 10)\n\n# Cross validation of model with polynomial degree 2\ncv_model_bic <- train(TotalDisasterCount ~ poly(Year, 2), \n                      data = disaster_subgroup_yearly, \n                      method = \"lm\", \n                      trControl = train_control)\n\n# Cross validation of model with polynomial degree 5\ncv_model_aic <- train(TotalDisasterCount ~ poly(Year, 5), \n                      data = disaster_subgroup_yearly, \n                      method = \"lm\", \n                      trControl = train_control)\n\n\nprint(cv_model_bic)\nprint(cv_model_aic)","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:58:59.051523Z","iopub.execute_input":"2024-06-23T10:58:59.05342Z","iopub.status.idle":"