e/png":{"width":720,"height":480}}}]},{"cell_type":"markdown","source":"## Alternative to LM Method\n\nAlternatively, we can use the Generalized Additive Models (GAM) method, which provides more flexibility. It allows the inclusion of non-linear functions for each predictor, leading to more accurate and reliable results.","metadata":{}},{"cell_type":"code","source":"options(warn = -1)\n\nggplot(disaster_subgroup_yearly, aes(x = Year, y = TotalDisasterCount, size = TotalDeaths, color = DisasterSubgroup)) +\n    geom_point(alpha = 0.8) +\n    # Add regression line degree 2 with geom smooth\n    geom_smooth(method = \"gam\", \n                formula = y ~ s(x, bs = \"cs\"), \n                se = FALSE, \n                lwd = 1, \n                linetype = \"dashed\") +\n    scale_size_continuous(range = c(1, 8)) +\n    scale_x_continuous(breaks = seq(1990,2023, by = 1)) +\n    theme_classic() +\n    scale_color_viridis_d(option = \"H\") +\n    labs(title = \"Annual Trend of Disaster Count \nby Disaster Subgroup and Total Deaths with Regression Line\nUsing gam Method\",\n       x = \"Year\",\n       y = \"Disaster Count\",\n       size = \"Total Deaths\",\n       color = \"Disaster Subgroup\") +\n  theme(plot.title = element_text(size = 18, face = \"bold\", hjust = 0.5),\n      legend.position = \"right\", \n        axis.title = element_text(size=15, face=\"bold\"), \n        axis.text.y = element_text(size=12), \n        legend.text = element_text(size=12),\n        legend.title = element_text(size=12, face=\"bold\"),\n        axis.text.x = element_text(angle=45, vjust=0.5)) ","metadata":{"execution":{"iopub.status.busy":"2024-06-23T10:59:14.411446Z","iopub.execute_input":"2024-06-23T10:59:14.413347Z","iopub.status.idle":"2024-06-23T10:59:16.204057Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2DTxt8H8POOnTh77wQSEiCEFQh7703Z